import React from 'react'
function go() {
    window.location = '/cmds'
}

function func(event) {
    let x = event.code
    if (x === 'Enter') {
        this.setState({ go: true })
    }
}

class Admin extends React.Component {
    state = {
        cmd: '',
        go: false
    }
    render() {
        if (this.state.go === true) {
            (e) => {
                if (e.target.value === 'Addaccount') {
                    console.log("goog")
                }
            }
        }
        return (
            <div>
                <input type="text" onKeyPress={func} value={this.state.cmd} required onChange={(e) => this.setState({ cmd: e.target.value })} />
                <br />
                <br />
                <button onClick={go}>Commands</button>
            </div>
        )
    }
}

export default Admin
